import React from 'react';
import { connect, useEffect, useSelector } from "react-redux";

import TableList from '../../components/Table/TableList'

//import TestServer from '../components/testServer/testServer';
//import {loadData} from '../store/testServer/actions/actionTestServer';
//    const dispatch = useDispatch();

function ContTable (props){
   
    const stateTable = useSelector(state => state.stateTable);
    
    console.log("stateTable ", Object.keys(stateTable[0]))
    
    
    return(
        <TableList 
                    columnName={Object.keys(stateTable[0])}
                    dataTable = {stateTable}
            />
    )
}

export default  connect()(ContTable)
